import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Navbar extends Component {

    render() {
        return (
            <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
                <Link to="/" classNam="navbar-brand">Tracker</Link>
                <div className="collpase navbar-collapse">
                    <ul className="navbar-nav mr-auto">
                        <li className="navbar-item">
                            <link to="/" className="nav-link">Create Student Attendance</link>
                        </li>
                        <li className="navbar-item">
                            <link to="/" className="nav-link">Edit Student Attendance</link>
                        </li>
                        <li className="navbar-item">
                            <link to="/" className="nav-link">Check Student Attendance</link>
                        </li>
                    </ul>
                </div>
                </nav>
        );
    }
}
